import { Component, Input, ViewEncapsulation } from '@angular/core';
import SwiperCore, { Navigation, Swiper } from 'swiper';
SwiperCore.use([Navigation]);

@Component({
  selector: 'app-swiper-example',
  templateUrl: './swiper-example.component.html',
  styleUrls: ['./swiper-example.component.scss'],
  encapsulation: ViewEncapsulation.None,
})
export class SwiperExampleComponent {
  @Input() images: any = [];
  @Input() isNavigation: boolean = false;
  @Input() isWidthFull: boolean = false;
  public swiperConfig: any = {
    slidesPerView: 'auto',
    spaceBetween: 0,
  };
}
<swiper
  [navigation]="isNavigation"
  class="w-full"
  [ngClass]="{ 'sm:w-full': isWidthFull, 'sm:w-[800px]': !isWidthFull }"
  [config]="swiperConfig"
>
  <ng-template swiperSlide *ngFor="let img of images">
    <div class="relative flex justify-center">
      <img class="w-full h-[250px] md:h-[500px] z-0 bg-center" [src]="img" />
    </div>
  </ng-template>
</swiper>
